import random


def try_comp(a, d, n, s):
    if pow(a, d, n) == 1:
        return False
    for i in range(s):
        if pow(a, 2 ** i * d, n) == n - 1:
            return False
    return True


def primetest(n):
    if n < 3: return n == 2
    if n % 2 == 0: return False
    s, d = 0, n - 1
    while True:
        quo, rem = divmod(d, 2)
        if rem == 1:
            break
        s, d = s + 1, quo

    for i in range(15):
        if try_comp(random.randrange(2, n), d, n, s):
            return False
    return True


